import React, { useEffect, useState } from 'react';
import { Table } from  'reactstrap';

const TopList = (props) =>{

    useEffect(() => {
        console.log(props)
    }, []);

    return (
        <div>
            {JSON.stringify(props)}
            <Table hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>Artista</th>
                        <th>Ouvintes</th>
                        <th>?</th>
                    </tr>
                </thead>
                <tbody>
                    {/* {
                        props.artistas.map((artista) => {
                            return(
                                <tr>
                                    <th scope="row">1</th>
                                    <td>{artista.name}</td>
                                    <td>{artista.listeners}</td>
                                    <td></td>
                                </tr>
                            );
                        })
                    } */}
                </tbody>
            </Table>
        </div>
    );
}

export default TopList;
